class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        ds = {}
        for i in range(len(s)):
            ds[s[i]] = ds.get(s[i],0) + 1
        #print ds
        for i in range(len(t)):
            if t[i] not in ds:
                return t[i]
            ds[t[i]] = ds.get(t[i],0) - 1
        #print ds
        for k, v in ds.items():
            if v == -1:
                return k

def findTheDifference(s, t):
    """
    :type s: str
    :type t: str
    :rtype: str
    """
    ans = 0
    for c in s + t:
        ans ^= ord(c)
    return chr(ans)
    
